import './App.css';
import { useState } from 'react';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';


const Users=[
  {fname : 'vasumithra', lname : 'gorrepati', email : 'xyz@gmail.com'},
  {fname : 'Mahesh', lname : 'gorrepati', email : 'xyz@gmail.com'},  
];


export default function App() {
  const [adduser,setadduser] = useState(Users); 
  return (
    <div className='dashboard'>
      <UserForm adduser={adduser} setadduser={setadduser}/>
      <DisplayUsers adduser={adduser}/>
    </div>
  );
}

function UserForm({adduser,setadduser}){
  const [userForm,setuserForm] = useState({
    fname : "",
    lname : "",
    email : ""
  });
  const handleChange = (event) => {
    const id = event.target.id;
    const value = event.target.value;
    switch (id) {
      case "fname" : setuserForm((prev)=>{return {...prev,fname : value}})
      case "lname" : setuserForm((prev)=>{return {...prev,lname : value}})
      case "email" : setuserForm((prev)=>{return {...prev,email : value}})
    }
  };
  const onFormSubmit =(e) => {
    setadduser([...adduser,{...userForm}]);
   e.preventDefault();
   e.target.reset();
  }
  return(
   <>
   <form onSubmit={onFormSubmit}>
   <label htmlFor="fname">FirstName : </label>
   <input id="fname" onChange={handleChange}></input><br></br>
   <label htmlFor="lname">LastName : </label>
   <input id="lname" onChange={handleChange}></input><br></br>
   <label htmlFor="email">Email : </label>
   <input id="email" onChange={handleChange}></input><br></br>
   <button type='submit'>
    Submit
   </button>
   </form>
   </>
  );
}

function DisplayUsers(props){
  console.log(props.adduser);
  const listItems = props.adduser.map((element) => {
    return (
        <ul key={element.fname}>
            <li>{element.fname}</li>
            <li>{element.lname}</li>
            <li>{element.email}</li>
        </ul>
    );
});
if(Users.length>0){
return (
  <TableContainer component={Paper}>
  <Table sx={{ minWidth: 650 }} aria-label="simple table">
    <TableHead>
      <TableRow>
        <TableCell>FirstName</TableCell>
        <TableCell align="right">LastName</TableCell>
        <TableCell align="right">Email</TableCell>
      </TableRow>
    </TableHead>
    <TableBody>
      {props.adduser.map((row) => (
        <TableRow
          key={row.email}
          sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
        >
          <TableCell component="th" scope="row">
            {row.name}
          </TableCell>
          <TableCell align="right">{row.fname}</TableCell>
          <TableCell align="right">{row.lname}</TableCell>
          <TableCell align="right">{row.email}</TableCell>
        </TableRow>
      ))}
    </TableBody>
  </Table>
</TableContainer>
)
}
else{
  return <div>No Users to display</div>
}
}

